description:
English | CBR and CBZ | 5 Issues

Spider-Woman: Origin #1-5
Publisher:  Marvel
Publication Date:  February - June 2006

Writers:  Brian Michael Bendis and Brian Reed
Pencils, Inks, and Colors:  Jonathan Luna
Layouts:  Joshua Luna
Letterer:  Cory Petit

This all-new epic chronicles the intriguing secret history of Jessica Drew and her journey from child experiment to Hydra agent to S.H.I.E.L.D. agent to super hero to private eye to Avenger! Written by New Avengers scribe Brian Michael Bendis and searing-hot newcomer Brian Reed (Ms. Marvel), and featuring stunning full-color visuals by the Luna brothers (Ultra, Girls), this story is packed with intrigue leading directly into the upcoming Spider-Woman series (Spider-Woman v4 - Agent of S.W.O.R.D. (2009-2010) from Bendis and Eisner Award-winning artist Alex Maleev (Daredevil).

Thanks goes to Mantooth and DTs for this release.

